actionConfiguration.body:
(columnIndex) => {
		if (api_getRecentNearby.data === undefined) {
			return []
		}
		const data = api_getRecentNearby.data
		const items = [data[columnIndex], data[columnIndex + 5]]
		const results = items.map((item) => {
			return {
				...item,
				img: ""
			}
		})
		return results
	}

